import './App.css';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import Col from 'react-bootstrap/Col'
import InputGroup from 'react-bootstrap/InputGroup'
import FormControl from 'react-bootstrap/FormControl'
import Button from 'react-bootstrap/Button'
import React from 'react';
class  App extends React.Component() {

  handleChange=(e)=>{
    const {name,value}=e.target;
    this.setState({
      [name]:value
    })
  }

  render(){
  return (
    <div className="App">
      <Container fluid className="fullwindow">
        <Row>
          <Col md={1} style={{ border: '5px solid white',height:'975px',alignItems:'center' }}>SideBar</Col>
          <Col>
            <Row style={{height:'50px',border:'5px solid blue'}}>
              <InputGroup >
                <FormControl
                  placeholder="Enter the number "
                  onChange={this.handleChange}
                />
                <Button variant="outline-secondary" onClick={this.getData()}>Let's Go!</Button>
              </InputGroup>
            </Row>
            <Row style={{height:'25px'}}></Row>
            <Row style={{height:'300px',alignItems:'center',border:'5px solid orange',alignSelf:'center',justifyContent:'center'}}>This would containt the content of the number</Row>
            <Row style={{height:'400px',alignItems:'center',border:'5px solid white'}}><Col md={4}> Is prime card</Col>
              <Col >Divisors card</Col></Row>

            <Row style={{ alignSelf: 'center', justifyContent: 'center' ,border:'5px solid yellow',height:'200px',alignItems:'center'}}>
              this is the footer
            </Row></Col>
        </Row>
      </Container>
    </div>
  );
}
}

export default App;
